            <Grid container
                direction="row"
                justifyContent="center"
                alignItems="center"
                spacing={0}
            >
                <Grid item md={4}>
                    <div>YAZIYAZIYAZI</div>
                </Grid>
                <Grid item md={4}>
                    <img className='logo-image' src={logo} alt='logo' />
                </Grid>

            </Grid>
        </div>
    );
}
